    return (
        <article class="container page_body">
            <h1>Promoções</h1>
                       
            <Link  to="/cadastrar"className='btn btn-light'>Cadastrar Cupom &raquo;</Link><br/>
            
            <img src={requireimg}/>
           

                    
        
        </article>
    );
}

export default Promocoes;
